import React, { useState, useEffect } from 'react';
import { useTranslation } from 'react-i18next';
import { useDispatch, useSelector } from 'react-redux';
import axios from 'axios';
import { makeStyles } from '@material-ui/core/styles';
import { Button, Select, MenuItem, FormControl, InputLabel } from '@material-ui/core';


const useStyles = makeStyles((theme) => ({
root: {
display: 'flex',
flexDirection: 'column',
alignItems: 'center',
justifyContent: 'center',
height: '100vh',
background: 'linear-gradient(135deg, #f5f7fa 0%, #c3cfe2 100%)',
transition: 'background 0.5s ease',
},
formControl: {
margin: theme.spacing(1),
minWidth: 120,
},
selectEmpty: {
marginTop: theme.spacing(2),
},
}));


const PersonalizedSettings = () => {
const classes = useStyles();
const { t, i18n } = useTranslation();
const dispatch = useDispatch();
const { language, theme } = useSelector((state) => state.ui);
const [localLanguage, setLocalLanguage] = useState(language);
const [localTheme, setLocalTheme] = useState(theme);


useEffect(() => {
// Fetch user settings from the server
axios.get('/api/user/settings').then((response) => {
setLocalLanguage(response.data.language);
setLocalTheme(response.data.theme);
});
}, []);


const handleLanguageChange = (event) => {
const newLanguage = event.target.value;
setLocalLanguage(newLanguage);
i18n.changeLanguage(newLanguage);
dispatch({ type: 'SET_LANGUAGE', payload: newLanguage });
// Save the new language setting to the server
axios.post('/api/user/settings', { language: newLanguage });
};


const handleThemeChange = (event) => {
const newTheme = event.target.value;
setLocalTheme(newTheme);
dispatch({ type: 'SET_THEME', payload: newTheme });
// Save the new theme setting to the server
axios.post('/api/user/settings', { theme: newTheme });
};


return (
<div className={classes.root} style={{ background: localTheme === 'dark' ? 'linear-gradient(135deg, #1e1e1e 0%, #3c3c3c 100%)' : 'linear-gradient(135deg, #f5f7fa 0%, #c3cfe2 100%)' }}>
<FormControl className={classes.formControl}>
<InputLabel>{t('Language')}</InputLabel>
<Select value={localLanguage} onChange={handleLanguageChange}>
<MenuItem value={'en'}>English</MenuItem>
<MenuItem value={'es'}>Spanish</MenuItem>
<MenuItem value={'fr'}>French</MenuItem>
<MenuItem value={'de'}>German</MenuItem>
</Select>
</FormControl>
<FormControl className={classes.formControl}>
<InputLabel>{t('Theme')}</InputLabel>
<Select value={localTheme} onChange={handleThemeChange}>
<MenuItem value={'light'}>Light</MenuItem>
<MenuItem value={'dark'}>Dark</MenuItem>
</Select>
</FormControl>
<Button variant="contained" color="primary" onClick={() => alert(t('Settings saved!'))}>
{t('Save Settings')}
</Button>
</div>
);
};


export default PersonalizedSettings;
