<Route path="/dashboard" component={Dashboard} />
<Route path="/settings" component={PersonalizedSettings} />
<Route path="/" component={Home} />
</Switch>
</Router>
</ThemeProvider>
</I18nextProvider>
</Provider>
);
};


export default App;
